import React from "react";

const Counter = (props) => {
  let index = props.index;

  return (
    <div className="counter">
      <button
        className={`box ${props.handleStrike ? "ss" : "hidden"}`}
        onClick={() => props.changeScore(index, +1)}
      >
        {" "}
        ✔️{" "}
      </button>
    </div>
  );
};

export default Counter;
